import React from 'react';
import { GoogleLogin } from 'react-google-login';

const clientId = "660110466067-69udlgbrcl25a39sc1uhujv79kco4hak.apps.googleusercontent.com"

function Login() {
    const onSuccess = (res) => {
        console.log(`[Google Login Success] currentUser:`, res.profileObj);
    };
    const onFailure = (res) => {
        console.log(`[Google Login Failed] res`, res);
    };

    return <div>
        <GoogleLogin
        clientID={clientId}
        buttonText="Login"
        onSuccess={onSuccess}
        onFailure={onFailure}
        cookiePolicy={`single_host_origin`}
        style={{ marginTop: '100px'}}
        isSignedIn={true}
        />
    </div>    
 }

 export default Login;
